import React from 'react';
import Modal from 'react-bootstrap/Modal';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

let ProjectModal = (props) => {
  let project = props.project;
  return (
    <Modal
      {...props}
      size="xl"
      aria-labelledby="contained-modal-title-vcenter"
      // centered
    >
      <Modal.Header closeButton>
        <Modal.Title id="contained-modal-title-vcenter" style={{display: 'inline-block'}}>
          {project.project_name}
        </Modal.Title>

        {/* <div className="ml-auto"> */}
          <Button variant="outline-dark" className="ml-auto">Live Demo</Button>
          <Button className="ml-auto" variant="outline-dark">Github Repo</Button>
        {/* </div> */}
      </Modal.Header>

      <Modal.Body>
        {/* <Row className="text-center"> */}
          <Col xs={12}>
            <img src={project.image_urls[0]} alt="project 1" />
          </Col>
          <Col xs={12}>
            <img src={project.image_urls[1]} alt="project 2" />
          </Col>
        {/* </Row> */}
        <p>
          {project.description}
        </p>
      </Modal.Body>
      <Modal.Footer>
        <Button onClick={props.onHide}>Close</Button>
      </Modal.Footer>
    </Modal>
  );
}

export default ProjectModal;
